	public static class Instruments {

		private String instrumentName;
		private Instrument instrument = null;

		private Instruments(String highVersionName, String lowVersionName) {
			switch (ServerVersion.getVersion()) {
			case 13:
				instrumentName = highVersionName;
				instrument = getInstrument();
				break;
			case 12:
				instrumentName = highVersionName;
				instrument = getInstrument();
				break;
			case 11:
				instrumentName = lowVersionName;
				instrument = getInstrument();
				break;
			case 10:
				instrumentName = lowVersionName;
				instrument = getInstrument();
				break;
			case 9:
				instrumentName = lowVersionName;
				instrument = getInstrument();
				break;
			case 8:
				instrumentName = lowVersionName;
				instrument = getInstrument();
				break;
			case 7:
				instrumentName = lowVersionName;
				instrument = getInstrument();
				break;
			}
		}

		private Instrument getInstrument() {
			for (Instrument i : Instrument.values()) {
				if (i.toString().equalsIgnoreCase(instrumentName)) {
					return i;
				}
			}

			return null;
		}
		
		public void playInstrument(Player p, Note note) {
			Instrument i = instrument;
			if (i != null) {
				p.playNote(p.getLocation(), i, note);
			}
		}

		public void playInstrument(List<Player> players, Note note) {
			for (Player p : players) {
				playInstrument(p, note);
			}
		}
		
		public void broadcastInstrument(Note note) {
			for(Player p : Bukkit.getOnlinePlayers()) {
				playInstrument(p, note);
			}
		}
		
	}

